  //   }
  // },[user])

  return (
    <>
      {user == null ? <p>Loading</p> : <><div className=" pb-20">
        <Navbar nama={'user'} />
      </div><div className="flex flex-row px-20">
          <Identitas />
          <div className='px-6'>
            <Formprofile />
          </div>
          <div className='flex flex-col'>

            <Instruction />
          </div>
        </div><div>
          <div className={`${styles.flexCenter} py-16 `}>

          </div>
        </div></>}
    </>
  )
}

export default Profilemaba
